import React, { useState } from "react";
import "../styles.css";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";

const Account = () => {
  const [showPassword, setShowPassword] = useState(false);
  const [showConfirmPassword, setShowConfirmPassword] = useState(false);

  const show = (e) => {
    e.preventDefault();

    if (showPassword === false) {
      setShowPassword(true);
    } else {
      setShowPassword(false);
    }
  };

  const show_alt = (e) => {
    e.preventDefault();

    if (showConfirmPassword === false) {
      setShowConfirmPassword(true);
    } else {
      setShowConfirmPassword(false);
    }
  };

  return (
    <>
      <Navbar main_links="d-none" last_link_path="/" last_link_name="Back" />
      <section id="account">
        <div className="container">
          <div className="row">
            <div className="col-12 register bg-white shadow">
              <div className="row form-style shadow">
                <div className="col-12 p-5 text-center my-auto">
                  <h1 className="text-primary fw-bold mb-3">Login</h1>
                  <form action="">
                    <div class="col-12 input-group mb-3">
                      <span class="input-group-text" id="basic-addon1">
                        <i class="fa-regular fa-user"></i>
                      </span>
                      <input
                        type="text"
                        class="form-control"
                        placeholder="Username"
                        aria-label="Username"
                      />
                    </div>
                    <div class="col-12 input-group mb-3">
                      <span class="input-group-text">
                        <i
                          class={
                            showPassword
                              ? "fa-solid fa-lock-open"
                              : "fa-solid fa-lock"
                          }
                        ></i>
                      </span>
                      <input
                        type={showPassword ? "text" : "password"}
                        class="form-control"
                        placeholder="Password"
                        aria-label="Password"
                      />
                      <span class="input-group-text">
                        <button
                          className="text-primary border-0 bg-light"
                          onClick={show}
                        >
                          {showPassword ? "Hide" : "Show"}
                        </button>
                      </span>
                    </div>
                    <div class="col-12 mb-3">
                      <button type="submit" class="btn btn-primary">
                        Login
                      </button>
                    </div>
                    <div className="col-12">
                      <p className="text-primary">
                        Don't have an account?
                        <span className="text-black text-decoration-underline ms-3">
                          Register
                        </span>
                      </p>
                    </div>
                  </form>
                </div>
                
              </div>
              <div className="row d-flex">
                <div className="col-6 text-center p-5">
                  <img
                    src={process.env.PUBLIC_URL + "/images/logo.png"}
                    alt="Logo"
                  />
                  <div>
                    <h2 className="text-primary fw-bold">Welcome !</h2>
                    <p></p>
                  </div>
                </div>
                <div className="col-6 text-center p-5">
                  <img
                    src={process.env.PUBLIC_URL + "/images/logo.png"}
                    alt="Logo"
                  />
                  <div>
                    <h2 className="text-primary fw-bold">Welcome Back !</h2>
                    <p></p>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
      <Footer />
    </>
  );
};

export default Account;
